import React from 'react'
import ReactDOM from 'react-dom'

function List() {
    return (
        <ul>
            <li>Harshit</li>
            <li>Garg</li>
            <li>Muzaffarnagar</li>
            <li>M.I.E.T</li>
        </ul>
    );
}

export default List;
